import React from 'react';
import Moment from 'react-moment';
/* 모먼트js 값을 한국어로 받기 위해서는 아래와같은 코드가 필요하다. */
/* 예 AM => 오전 */

import 'moment/locale/ko';
import Clock from 'react-live-clock';

import clsx from 'clsx';
import { makeStyles } from '@material-ui/core/styles';
import CssBaseline from '@material-ui/core/CssBaseline';
import Box from '@material-ui/core/Box';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import IconButton from '@material-ui/core/IconButton';
import Container from '@material-ui/core/Container';
import Grid from '@material-ui/core/Grid';
import Paper from '@material-ui/core/Paper';
import MenuIcon from '@material-ui/icons/Menu';
import Fab from '@material-ui/core/Fab';
import SearchIcon from '@material-ui/icons/Search';
import MoreIcon from '@material-ui/icons/MoreVert';
import PlayArrowIcon from '@material-ui/icons/PlayArrow';
import Work from './components/Work';
import Vinfo from './components/Vinfo';

const useStyles = makeStyles((theme) => ({
    root: {
        display: 'flex',
    },
    toolbar: {
        paddingRight: 24, // keep right padding when drawer closed
        paddingLeft: 24,
    },
    appBar: {
        top: 'auto',
        bottom: 0,
    },
    fabButton: {
        position: 'absolute',
        zIndex: 1,
        top: -30,
        left: 0,
        right: 0,
        margin: '0 auto',
    },
    topSpacer: theme.mixins.toolbar,
    content: {
        flexGrow: 1,
        height: '100vh',
        overflow: 'auto',
    },
    container: {
        paddingTop: theme.spacing(4),
        paddingBottom: theme.spacing(4),
    },
    paper: {
        padding: theme.spacing(2),
        display: 'flex',
        overflow: 'auto',
        flexDirection: 'column',
    },
    fixedHeight: {
        height: 650,
    },
}));

export default function Driving() {
    const classes = useStyles();

    const fixedHeightPaper = clsx(classes.paper, classes.fixedHeight);

    return (
        <div className={classes.root}>
            <CssBaseline />

            <AppBar position="fixed" color="primary" className={classes.appBar}>
                <Toolbar>
                    <IconButton edge="start" color="inherit" aria-label="open drawer">
                        <MenuIcon />
                    </IconButton>
                    <Fab color="secondary" aria-label="add" className={classes.fabButton}>
                        <PlayArrowIcon />
                    </Fab>
                    <div className={classes.grow} />
                    <IconButton color="inherit">
                        <SearchIcon />
                    </IconButton>
                    <IconButton edge="end" color="inherit">
                        <MoreIcon />
                    </IconButton>
                    <Box marginLeft={2}>
                        <Typography variant="h6">

                            <Clock format={'A h:m:s'} ticking={true} timezone={'Asia/Seoul'} />
                        </Typography>
                    </Box>
                    <Box marginLeft={2}>
                        <Typography>{"실외온도 25°C"}</Typography>
                    </Box>
                </Toolbar>
            </AppBar>



            <main className={classes.content}>

                <Container maxWidth="lg" className={classes.container}>
                    <Typography gutterBottom variant="h2">
                        POTATO - Age of BE CONTROLLED by AI</Typography>
                    <Grid container spacing={3}>
                        <Grid item xs={12} md={7} lg={7}>

                            <Box >
                                <Paper className={classes.paper}>
                                    <Work />
                                </Paper>
                            </Box>


                            <Box marginTop={3}>
                                <Paper className={classes.paper}>
                                    <Vinfo />
                                </Paper>
                            </Box>
                        </Grid>

                        <Grid item xs={12} md={5} lg={5}>
                            <Paper className={fixedHeightPaper}>
                                <Typography color="textSecondary" variant="h3">FRONT/BACK Pi Camera</Typography>
                                <Typography color="textSecondary" variant="h3">mjpg/soket 영상 스트리밍</Typography>
                            </Paper>
                        </Grid>
                    </Grid>
                </Container>
            </main>
        </div >
    );
}
